	add("truce", "{\"term\":\"truce\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) \u0027trewes\u0027 \u0027triwes\u0027 \u0027trues\u0027 plural of \u0027trewe\u0027 \u0027triewe\u0027 \u0027true\u0027 ‘faithfulness, assurance, pact’, from Old english (ca. 450-1100) {{m|ang|trēowa}}, singularized plural of {{m|ang|trēow}}, {{m|ang|trȳw||faith; pledge; agreement}}, from Proto-germanic {{m|gem-pro|*trewwō}} (compare Dutch \u0027trouw\u0027 German \u0027treue\u0027 Danish \u0027tro\u0027 , noun form of {{m|gem-pro|*triwwiz||trusty, faithful}}. More at {{l|en|true}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a period of time in which no fighting takes place due to an agreement between the opposed partie\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"an agreement between opposed parties in which they pledge to cease fighting for a limited time\", \"priority\":2}]}, \"synonyms\":{}}");

