	add("trudeaumania", "{\"term\":\"trudeaumania\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|Trudeau|mania|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Fervent admiration of former Canadian Prime Minister w:Pierre Elliot Pierre Elliott Trudeau (1919-2000), especially during his 1968 election campaign and his early years in office\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1968\u0027\u0027, Sally Barnes, \u0026quot;\u0027\u0027Trudeaumania\u0027\u0027 a bonanza for Metro Liberals,\u0026quot; \u0027Toronto Daily Star\u0027 (Toronto), 4 May, p. 13\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Conservatives deny that what they refer to as \u0027\u0027Trudeaumania\u0027\u0027 has scared candidates from their ranks\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1971\u0027\u0027, \u0026quot;Canada \u002772—dull and grey, but still very real\u0026quot; (editorial), \u0027Globe and Mail\u0027 (Toronto), 1 Jul, p. 7\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Pierre Elliott Trudeau, Canada\u0027s own distinctive revolution in democratic political style; the swinger, the all-round athlete: \u0027\u0027Trudeaumania\u0027\u0027 as overture to the Just Society\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, John Geddes, \u0026quot;[http://www.macleans.ca/article.jsp?content\u003d20060417_125095_125095\u0026amp;source\u003dsrch Michael Ignatieff and Bob Rae are pals. Really.],\u0026quot; \u0027Macleans\u0027 (Canada), 17 Apr. (retrieved 20 Jan. 2009\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"During the 1968-69 school year, remembered for its anti-Vietnam War demonstrations and \u0027\u0027Trudeaumania\u0027\u0027, Michael Ignatieff and Bob Rae shared a cheap apartment\", \"priority\":7}]}, \"synonyms\":{}}");

	add("trudge", "{\"term\":\"trudge\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Mid-16th century. Original meaning was somewhat idiomatic, meaning \u0026quot;to walk using snowshoes.\u0026quot; Probably of Scandinavian origin, compare Icelandic þrūga (\u0026quot;snowshoe\u0026quot;), Norwegian truga (\u0026quot;snowshoe\u0026quot;) and dialectal Swedish trudja (\u0026quot;snowshoe.\u0026quot;).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A tramp, i.e. a long and tiring walk\", \"priority\":1}]}, \"synonyms\":{}}");

