	add("truffle", "{\"term\":\"truffle\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"old provençal (to 1500)\"], \"text\":\"The word in the Germanic languages (:w:is:Jarðsveppur|except Icelandic) is a loanword from French \u0027truffe\u0027 (previously trufle)\u0026lt;ref\u0026gt;[http://germazope.uni-trier.de/Projects/WBB/woerterbuecher/dwb/wbgui?lemmode\u003dlemmasearch\u0026amp;mode\u003dhierarchy\u0026amp;textsize\u003d600\u0026amp;onlist\u003d\u0026amp;word\u003dTruffel\u0026amp;lemid\u003dGT11734\u0026amp;query_start\u003d1\u0026amp;totalhits\u003d0\u0026amp;textword\u003d\u0026amp;locpattern\u003d\u0026amp;textpattern\u003d\u0026amp;lemmapattern\u003d\u0026amp;verspattern. GT11734L0 Etymology in] :w:de:Deutsches Wörterbuch von Jacob und Wilhelm Grimm|Deutsches Wörterbuch von Jacob und Wilhelm Grimm: \u0027im Laufe des 18. Jahrhunderts entlehnt aus Französischem neben gewöhnlichem truffe stehendem truffle\u0027\u0026lt;/ref\u0026gt; (whence Danish and Norwegian \u0027trøffel\u0027 German \u0027trüffel\u0027 \u0026lt;ref\u0026gt;[http://ordnet.dk/ods/opslag?opslag\u003dtr%F8ffel\u0026amp;submit\u003dS%F8g Etymology] in :da:ODS|ODS: \u0026quot;eng. truffle; fra fr. trufle (truffe)\u0026quot;\u0026lt;/ref\u0026gt;, which originates from Old provençal (to 1500) \u0026lt;ref\u0026gt;\u0027:w:Dictionnaires Le Robert|Le Robert pour tous, Dictionnaire de la langue française\u0027, Janvier 2004, p. 1144, \u0027truffe\u0027\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of various edible fungi, of the genus \u0027Tuber\u0027, that grow in the soil in southern Europe; the earthnut\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A creamy chocolate confection, in the form of a ball, covered with cocoa powder\", \"priority\":2}]}, \"synonyms\":{}}");

