	add("trull", "{\"term\":\"trull\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\"], \"text\":\"From German \u0027trulle\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A female prostitute or harlot\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1749\u0027\u0027, Henry Fielding, \u0027Tom Jones\u0027, Folio Society 1973, p. 365\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"‘Hark\u0027ee, child,’ says she, ‘is not that very young gentleman now in bed with some nasty \u0027\u0027trull\u0027\u0027 or other\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1888\u0027\u0027, Rudyard Kipling, ‘Dray Wara Yow Dee’, \u0027Black and White\u0027, Folio Society 2004, vol. 1, p. 369\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"South of Delhi, \u0027Sahib\u0027, you know the saying—‘Rats are the men and \u0027\u0027trulls\u0027\u0027 the women\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1922\u0027\u0027, James Joyce, \u0027Ulysses\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"There was bad blood between them at first, says Mr Vincent, and the lord Harry called farmer Nicholas all the old Nicks in the world and an old whoremaster that kept seven \u0027\u0027trulls\u0027\u0027 in his house and I’ll meddle in his matters, says he\", \"priority\":7}]}, \"synonyms\":{}}");

	add("trumpet", "{\"term\":\"trumpet\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"middle dutch (ca. 1050-1350)\", \"English\", \"middle english (1100-1500)\", \"frankish\", \"old french (842-ca. 1400)\", \"middle low german\", \"old high german (ca. 750-1050)\"], \"text\":\"From Middle english (1100-1500) \u0027trumpette\u0027 \u0027trompette\u0027 (trumpet) from Old french (842-ca. 1400) \u0027trompette\u0027 (trumpet) diminutive of \u0027trompe\u0027 (horn, trump, trumpet) from Frankish {{m|frk|*trumpa}}, {{m|frk|*trumba||trumpet}}. Akin to Old high german (ca. 750-1050) \u0027trumpa\u0027 \u0027trumba\u0027 (horn, trumpet) Middle dutch (ca. 1050-1350) \u0027tromme\u0027 (drum) Middle low german \u0027trumme\u0027 (drum) More at {{l|en|drum}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A musical instrument of the brass family, generally tuned to the key of B-flat; by extension, any type of lip-vibrated aerophone, most often valveless and not chromatic\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The royal herald sounded a \u0027\u0027trumpet\u0027\u0027 to announce their arrival\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In an orchestra or other musical group, a musician that plays the trumpet\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027trumpets\u0027\u0027 were assigned to stand at the rear of the orchestra pit\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The cry of an elephant\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The large bull gave a basso \u0027\u0027trumpet\u0027\u0027 as he charged the hunters\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"One who praises, or propagates praise, or is the instrument of propagating it\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Dryde\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"That great politician was pleased to have the greatest wit of those times to be the \u0027\u0027trumpet\u0027\u0027 of his praises\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A funnel, or short flaring pipe, used as a guide or conductor, as for yarn in a knitting machine\", \"priority\":10}]}, \"synonyms\":{}}");

	add("trumpeter", "{\"term\":\"trumpeter\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|trumpet|er|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Someone who plays a trumpet\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any of three species of bird in the family Psophiidae from South America named for the trumpeting threat call of the males\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Any of a number of breeds of domestic fancy pigeon in the family Columbidae (originally bred for their peculiar gurgling voice, a prolonged coo called \u0026quot;trumpeting\u0026quot; or \u0026quot;drumming\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"One who proclaims, publishes, or denounces\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Francis Baco\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"These men are good \u0027\u0027trumpeters\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"An American swan () with a very loud note\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A large edible fish () of the family \u0027\u0027, native to Tasmania and New Zealand\", \"priority\":8}]}, \"synonyms\":{}}");

