	add("truncheon", "{\"term\":\"truncheon\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027tronchon\u0027 (thick stick) from *\u0027\u0027 () from Latin \u0027truncus\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fragment or piece broken off from something, especially a broken-off piece of a spear or lance\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Bk.VII\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Helpe me that thys \u0027\u0027truncheoune\u0027\u0027 were oute of my syde, for hit stykith so sore that hit nyghe sleyth me\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1596\u0027\u0027, \u0027The Faerie Queene\u0027, IV.3\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Therewith asunder in the midst it brast, / And in his hand nought but the \u0027\u0027troncheon\u0027\u0027 left\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"The shaft of a spear\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A short staff, a club; a cudgel\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"c.1552–1599\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"With his \u0027\u0027truncheon\u0027\u0027 he so rudely struck\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1786\u0027\u0027, Francis Grose, \u0027A Treatise on Ancient Armour and Weapons\u0027, p.52\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"One is a large ball of iron, fastened with three chains to a strong truncheon or staff of about two feet long; the other is of mixed metal, in the form of a channelled melon, fastened also to a staff by a triple chain; these balls weigh eight pounds\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"A baton, or military staff of command, now especially the stick carried by a police officer\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"1604\u0027\u0027, William Shakespeare, \u0027Measure for Measure\u0027, Act II, Scene II, l.60\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Not the king\u0027s crown, nor the deputed sword\u0026lt;!--,--\u0026gt; / The marshal\u0027s \u0027\u0027truncheon\u0027\u0027, nor the judge\u0027s robe\u0026lt;!--,--\u0026gt; / Become them with one half so good a grace / As mercy does\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A stout stem, as of a tree, with the branches lopped off, to produce rapid growth\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"A penis\", \"priority\":16}]}, \"synonyms\":{}}");

	add("trundle", "{\"term\":\"trundle\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From a variation of \u0027trendle\u0027 \u0027trindle\u0027 More at {{l|en|trindle}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A low bed on wheels that can be rolled underneath another bed\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A small wheel or roller\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A motion as of something moving upon little wheels or rollers; a rolling motion\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A lantern wheel, or one of its bars\", \"priority\":4}]}, \"synonyms\":{}}");

