	add("trust", "{\"term\":\"trust\", \"etymology\":{\"influencers\":[], \"languages\":[\"Danish\", \"German\", \"English\", \"middle english (1100-1500)\", \"West Frisian\", \"gothic\", \"Dutch\", \"old norse\", \"saterfriesisch\"], \"text\":\"From Middle english (1100-1500) \u0027truste\u0027 (trust, protection) from Old norse \u0027traust\u0027 (confidence, help, protection) from Proto-germanic {{m|gem-pro|*traustą}}, from Proto-indo-european {{m|ine-pro|*drowzdo-}}, from Proto-indo-european {{m|ine-pro|*deru-||be firm, hard, solid}}. Akin to Danish \u0027trøst\u0027 Saterfriesisch \u0027traast\u0027 (comfort, solace) West frisian {{m|fy|treast||comfort, solace}}, Dutch \u0027troost\u0027 (comfort, consolation) German \u0027trost\u0027 (comfort, consolation) Gothic \u0027trausti\u0027 (alliance, pact) More at true, tree.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Confidence in or reliance on some person or quality\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He needs to regain her \u0027\u0027trust\u0027\u0027 if he is ever going to win her back\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"John Lock\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Most take things upon \u0027\u0027trust\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1671\u0027\u0027, O ever-failing \u0027\u0027trust\u0027\u0027 / In mortal strength! — John Milton, \u0027Samson Agonistes\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Dependence upon something in the future; hope\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1611\u0027\u0027, Such \u0027\u0027trust\u0027\u0027 have we through Christ. — \u0027Authorised Version\u0027, 2 Corinthians iii:4\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Confidence in the future payment for goods or services supplied; credit\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"I was out of cash, but the landlady let me have it on \u0027\u0027trust\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"That which is committed or entrusted; something received in confidence; a charge\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"That upon which confidence is reposed; ground of reliance; hope\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Bible, Psalms, lxxi\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"O Lord God, thou art my \u0027\u0027trust\u0027\u0027 from my youth\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Trustworthiness, reliability\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"The condition or obligation of one to whom anything is confided; responsible charge or office\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Shakespear\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"I] serve him truly that will put me in \u0027\u0027trust\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"Denha\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Reward them well, if they observe their \u0027\u0027trust\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"The confidence vested in a person who has legal ownership of a property to manage for the benefit of another\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"I put the house into my sister\u0027s \u0027\u0027trust\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"An estate devised or granted in confidence that the devisee or grantee shall convey it, or dispose of the profits, at the will, or for the benefit, of another; an estate held for the use of another\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"A group of businessmen or traders organised for mutual benefit to produce and distribute specific commodities or services, and managed by a central body of trustees\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"Affirmation of the access rights of a user of a computer system\", \"priority\":24}]}, \"synonyms\":{}}");

