	add("trustee", "{\"term\":\"trustee\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|trust|ee|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person to whom property is legally committed in trust, to be applied either for the benefit of specified individuals, or for public uses; one who is intrusted with property for the benefit of another; also, a person in whose hands the effects of another are attached in a trustee process\", \"priority\":1}]}, \"synonyms\":{}}");

