	add("truth", "{\"term\":\"truth\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\", \"middle english (1100-1500)\", \"Icelandic\"], \"text\":\"From Middle english (1100-1500) {{m|enm|truthe}}, {{m|enm|trewthe}}, {{m|enm|treowthe}}, from Old english (ca. 450-1100) {{m|ang|trēowþ}}, {{m|ang|trīewþ||truth, veracity, faith, fidelity, loyalty, honour, pledge, covenant}}, from Proto-germanic {{m|gem-pro|*triwwiþō||promise, covenant, contract}}, from Proto-indo-european {{m|ine-pro|*drū-||tree}}, from Proto-indo-european {{m|ine-pro|*deru-||firm, solid}}, equivalent to {{suffix|true|th|lang\u003den}}. Cognate with Norwegian {{m|no|trygd||trustworthiness, security, insurance}}, Icelandic \u0027tryggð\u0027 (loyalty, fidelity)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being true to someone or something\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Faithfulness, fidelity\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1772-1834\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Alas! they had been friends in youth, / But whispering tongues can poison \u0027\u0027truth\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A pledge of loyalty or faith\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"True facts, genuine depiction or statements of reality\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1772-1834\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027truth\u0027\u0027 depends on, or is only arrived at by, a legitimate deduction from all the facts which are truly material\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/books-and-arts/21604535-real-sir-isaac-newton-was-not-first-king-reason-last Magician’s passage\u003dThe \u0027\u0027truth\u0027\u0027 is that [Isaac] Newton was very much a product of his time. The colossus of science was not the first king of reason, Keynes wrote after reading Newton’s unpublished manuscripts. Instead “he was the last of the magicians”\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Conformity to fact or reality; correctness, accuracy\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.americanscientist.org/issues/feature/2012/1/how-to-be-manipulative How to Be passage\u003dAs in much of biology, the most satisfying \u0027\u0027truths\u0027\u0027 in ecology derive from manipulative experimentation. Tinker with nature and quantify how it responds\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Conformity to rule; exactness; close correspondence with an example, mood, model, etc\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"https://en.wikisource.org/wiki/Mortimer,_John_(DNB00) John Mortimer] (1656?-1736\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Ploughs, to go true, depend much on the \u0027\u0027truth\u0027\u0027 of the ironwork\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"That which is real, in a deeper sense; spiritual or ‘genuine’ reality\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"Beauty is \u0027\u0027truth\u0027\u0027, \u0027\u0027truth\u0027\u0027 beauty, - that is all / Ye know on earth, and all ye need to know\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"Something acknowledged to be true; a true statement or axiom\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"It is a \u0027\u0027truth\u0027\u0027 universally acknowledged, that a single man in possession of a good fortune, must be in want of a wife\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"Topness. (See also truth quark\", \"priority\":19}]}, \"synonyms\":{}}");

	add("truthbearer", "{\"term\":\"truthbearer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|truth|bearer|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An entity that is said to be either true or false\", \"priority\":1}]}, \"synonyms\":{}}");

	add("truther", "{\"term\":\"truther\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|truth|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person believing that the United States government perpetrated or allowed the 9/11 terrorist attacks\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"May 22, 2006\u0027\u0027, George Washington, \u0027[http://georgewashington.blogspot.com/2006/05/social-proof.html Social Proof]\u0027, George Washington\u0027s Blog\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Therefore, virtually every press release or statement about 9/11 should include a reference to the poll to show people that many Americans are 9/11 \u0027\u0027truthers\u0027\u0027 who scoff at the 9/11 Commission as a fraud and that demand a real 9/11 investigation\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"September 13, 2009\u0027\u0027, Stephen Collinson, \u0027[http://www.dailymail.co.uk/news/worldnews/article-1212723/Eight-years-Americas-Muslims-fear-backlash-nation-grieves-3-000-lost-9-11.html New York reveals demands for new 9/11 probe may go to vote as Americans mark eighth anniversary]\u0027, The Sunday Mail\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The vote is likely to tear open old wounds as groups such as the \u0026quot;\u0027\u0027truthers\u0027\u0027\u0026quot;, including actor Charlie Sheen who believe Americans have never been told the truth about what really happened on 9/11, try to persuade New Yorkers to open a new probe that would reinvestigate the attacks\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"September 20, 2009\u0027\u0027, David Ignatius, \u0027[http://www.washingtonpost.com/wp-dyn/content/article/2009/09/18/AR2009091802144.html Reading Iran by the Letter]\u0027, The Washington Post\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The Iranian president is even a \u0026quot;\u0027\u0027truther\u0027\u0027,\u0026quot; insisting that there was a hidden hand behind Sept. 11, 2001. \u0026quot;Could it be planned and executed without coordination with intelligence and security services — or their extensive infiltration?\u0026quot; he mused in the letter to Bush\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A person believing that the United States government perpetrates, supports, funds or allows false flag attacks\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"2013\u0027\u0027, D Wittkower, Philip K. Dick and Philosoph\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"For instance, \u0026quot;\u0027\u0027truthers\u0027\u0027\u0026quot; who believe in a US government conspiracy to destroy the pentago\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, Lori, Badura, Tell It Like It Isn\u0027t (Page 226\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Rather, believers of this conspiracy theory (known as Sandy Hook “\u0027\u0027truthers\u0027\u0027”) propose that the entire event might have been staged by Homeland Security and FEM\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2014\u0027\u0027, Ralph Cinque, A review of the trailer of James Lambert\u0027s new film Group: alt.assassination.jf\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"because I think that we JFK \u0027\u0027truthers\u0027\u0027 may be able to use this film to our\", \"priority\":14}]}, \"synonyms\":{}}");

