	add("truthiness", "{\"term\":\"truthiness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|truthy|ness|lang\u003den}}. Modern sense created in the 17 October 2005 episode of \u0027{{w|The Colbert Report}}\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Truthfulness\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Superficial or asserted truthfulness, without recourse to evidence\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, \u0027The Colbert Report\u0027, 17 Oct 2005, (transcription\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Cause you\u0027re looking at a straight-shooter, America. I tell it like it is. I calls \u0027em like I sees \u0027em. I will speak to you in plain simple English. And that brings us to tonight\u0027s word: \u0027\u0027truthiness\", \"priority\":4}]}, \"synonyms\":{}}");

	add("truthmaker", "{\"term\":\"truthmaker\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|truth|maker|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"That entity in virtue of which a truthbearer is true\", \"priority\":1}]}, \"synonyms\":{}}");

