	add("truthtelling", "{\"term\":\"truthtelling\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|truth|telling|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Telling the truth\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, Glen Harold Stassen, David P Gushee, \u0027Kingdom ethics: following Jesus in contemporary context\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A reading of Matthew 5:33-37, the fourth of the triads in the Sermon, requires us to devote our attention to the moral issues associated with \u0027\u0027truthtelling\", \"priority\":3}]}, \"synonyms\":{}}");

